import React from "react";
import Shifter from "./Shifter";
import "./Items.css";
import ShifterText from "./ShifterText";

const Items = (props) => {
  if (props.data.length === 0) {
    return;
  }

  return (
    <div className="item___main">
        <ul className="item___half">
          {props.data.map((shifter) => {
            return <Shifter time={shifter.time} employee={shifter.employee} />;
          })}
        </ul>
      <ul className="item___half">
      {props.data.map((shifter) => {
            return <ShifterText time={shifter.time} employee={shifter.employee} />;
          })}
      </ul>
    </div>
  );
};

export default Items;
